import { Box, Center } from "@chakra-ui/react";
import { gymInformation } from "../dummy";

const HereDetailScreen = () => {
  const { name } = gymInformation;
  return (
    <>
      <Box
        borderWidth="1px"
        borderRadius="lg"
        maxW="lg"
        color="white"
        bg="blue.500"
        m="auto"
      >
        <Center w="100%" h="40">
          {name}
        </Center>
      </Box>
      <div>detail</div>
    </>
  );
};

export default HereDetailScreen;
